import { ComingSoon, ComingSoonRegister, RegisteredUserPage } from "../pages";

const routes = [
    {
        path: '/',
        component: ComingSoon,
    },
    {
        path: '/comingsoonregister',
        component: ComingSoonRegister,
    },
    {
        path: '/register',
        component: RegisteredUserPage,
    },
];

export default routes;
